export function LotteryButton(props) {
  const { wasDraw, ...attributes } = props;

  return (
    <button disabled={!!wasDraw} {...attributes}>
      {wasDraw ? "Numero estratto" : "Clicca per estrarre un numero"}
    </button>
  );
}
